import React from 'react';
import Squares from './Squares';

export default function Rows({ fillSquare, board, game, winners }) {
  console.log(game);
  if (game.finished) {
    //   winners = [a,b,c]
    return (
      <>
        <div className='b-row first-row'>
          <Squares sPos='0' fillSquare={fillSquare} board={board} />
        </div>
        <div className='b-row second-row'>
          <Squares sPos='3' fillSquare={fillSquare} board={board} />
        </div>
        <div className='b-row third-row'>
          <Squares sPos='6' fillSquare={fillSquare} board={board} />
        </div>
      </>
    );
  } else {
    return (
      <>
        <div className='b-row first-row'>
          <Squares sPos='0' fillSquare={fillSquare} board={board} />
        </div>
        <div className='b-row second-row'>
          <Squares sPos='3' fillSquare={fillSquare} board={board} />
        </div>
        <div className='b-row third-row'>
          <Squares sPos='6' fillSquare={fillSquare} board={board} />
        </div>
      </>
    );
  }
}
